places.forEach(place => {
    place.data = JSON.parse(place.data)
})

const fs = require('fs')
const jsonFormat = require('json-format');

var unresolved = places.filter(place => place.data.status !== 'OK');
var resolved = places.filter(place => place.data.status === 'OK');



resolved.forEach(place => {
    place.name = place.place;
    place.location = place.data.results[0].geometry.location;
    place.category = "";

    delete place.place;
    delete place.data;
})

unresolved.forEach(place => {
    place.name = place.place;
    place.location = {"lat":0,"lng":0};
    place.category = "";

    delete place.place;
    delete place.data;
})

places  = resolved.concat(unresolved).map(place => {
    var nameComponents;
    place.name = place.name.replace('<span>', '').replace('</span>', '');
    nameComponents = place.name.split(',');
    place.name = nameComponents[0];
    place.address = nameComponents[1];
    return place;
});

fs.writeFile('places.json', "window.places = " +jsonFormat(places), (err) => {
    // throws an error, you could also catch it here
    if (err) throw err;

    // success case, the file was saved
    console.log('places saved!');
});     
